window.bookSummaryJSON = "<p>An embattled realm mystically entwined with our own, the Otherworld is at the mercy of one woman....</p> <p>Shaman-for-hire Eugenie Markham is the best at banishing entities trespassing in the mortal realm. But as the Thorn Land's queen, she's fast running out of ways to end the brutal war devastating her kingdom. Her only hope: the Iron Crown, a legendary object even the most powerful fear....</p> <p>But who can she trust to help her? Fairy king Dorian has his own agenda. And Kiyo, her shape-shifter ex-boyfriend, has every reason to betray her. To control the Crown's all-consuming powers, Eugenie must confront an unimaginable temptation - one which puts her soul and the fate of two worlds in mortal danger....</p>"; 
